import React from 'react'
import { Row, Col } from 'react-bootstrap'
import UsersChart from '../../components/UsersChart'
import WeekOrdersPie from '../../components/WeekOrdersPie'

const DashboardView = () => {
    return (
        <Row mt-5>
            <Col md={6}><UsersChart /></Col>
            <Col md={6}><WeekOrdersPie /></Col>
        </Row>
    )
}

export default DashboardView
